import React from 'react';
import './input.css'
import { useState } from 'react';

const Input = (props) => {
        props.value = ''
    return (
        <input onChange={(event)=> props.setValue(event.target.value)}
               value={props.value}
               type={props.type}
               placeholder={props.placeholder}/>
    );
};


export default Input;
